import DialogItem from "../Message/DialogItem/DialogsItem";


function Users(props) {
    let state = props.usersPage
    let usersElements = state.users.map(u =>
        <div key={u.id}>
            // for avatar and button "follow"
            <span>
                <div> <img/> </div>
                <div>
                    <button>Follow</button>
                </div>
            </span>
            // for name, location and status
            <span></span>
        </div>)
    return (<div>
        {usersElements}
    </div>)
}

export default Users;
